$.aH6=A.a(["On Saturday, March 18, BU MET\u2019s team participated in the annual National Centers of Academic Excellence in Cybersecurity Cyber Games Competition, sponsored by the US National Security Agency. The team placed fourth overall in the competition and third in its infrastructure section. The all-day event saw the seven-person team, joined by Cybersecurity Director Yuting Zhang, build and maintain a fully functional computer network\u2014including a MySQL database server, web server, multiple external and internal Linux VMs, backup server, DNS server, Shell/FTP server, and a router\u2014and to defend it from cyber attackers while scoring points by securing virtual flags.","Qwiklabs is an online platform that provides hands-on training and labs for cloud computing and related technologies, including those from Google Cloud. On Qwiklabs, users can complete labs, earn badges, and receive certificates upon successfully finishing courses and hands-on exercises. The badges and certificates are awarded by Qwiklabs to signify the user's achievement in completing specific tasks or courses.",'The "Hall of Fame (Udemy Top Learner) award" from Cognizant refers to an accolade or recognition given to a Cognizant employee who has achieved top performance or excellence in learning and training through Udemy, an online learning platform. Udemy offers a wide range of courses on various topics, including technology, business, and personal development. Earning the "Hall of Fame (Udemy Top Learner) award" typically indicates that an individual within Cognizant has demonstrated exceptional dedication to continuous learning and professional development through Udemy courses.',"Created a java based tool for reducing the number of incidents. It generated a daily report for audit. Later the tool became an integral part of the project. I was awarded the \u201cStellar Performer Award\u201d for creating this tool \n\n * ABOUT THE TOOL: \nIt is a Java based tool used to compare two separate data sources and find the mismatches between them. After the mismatches are detected, they are fixed by the tool itself. The main objective is to keep the two data sources in sync. \n(HR-System \u2192 Enterprise Directory \u2192 Active Directory) \n\n* BENEFITS:\nREDUCTION of INCIDENT COUNT as it takes care of all data issues. \nSAVES A LOT OF TIME since it takes less than 30 minutes to scan and fix the whole system data. \nPROMOTES MULTI TASKING since it can run in background. \nREPORTS are generated daily which helps us to track the root cause of the data issues.","Cognizant has awarded me the \"Feather on the Cap\" title as a recognition of my dedication, expertise, and significant contributions in the field of identity and access management. My ability to design and implement secure Single Sign-On solutions, manage certificates and keys, and integrate 40+ applications with ADFS and PingFederate has positively impacted the organization's security and user experience. Implementing Multi-Factor Authentication and building custom rules tailored to clients' needs further demonstrates my commitment to enhancing access security and addressing unique requirements. Additionally, my documentation efforts have promoted transparency and knowledge sharing within the organization. This award signifies my substantial role in improving access management processes and enhancing the overall security landscape for Cognizant.",'Cognizant has awarded me the "Spotlight Award" to acknowledge my exceptional dedication, problem-solving abilities, and contributions in incident and problem management. My ability to identify root causes, fix bugs, and actively engage in long-term problem resolution demonstrates my commitment to delivering high-quality solutions. Furthermore, my effective coordination with external stakeholders and proactive system monitoring have contributed to improved incident management and system stability. This award signifies my pivotal role in enhancing operational efficiency and maintaining service excellence within the organization.',"In 2014, I achieved a significant milestone by passing the rigorous GATE (Graduate Aptitude Test in Engineering) exam, which is known for its challenging nature. What sets me apart is my unwavering commitment to excellence, as I not only passed the GATE exam but also strived for continuous improvement. \n\nIn 2020, I returned to the GATE examination, determined to surpass my previous performance. It was a journey of dedication, hard work, and relentless pursuit of knowledge. I achieved not just success but an even higher score, a testament to my continuous learning and growth in the field of engineering and technology.\n\nThe importance of passing the GATE exam cannot be overstated. It is not merely an examination; it is the gateway to a world of opportunities. GATE qualification has opened doors to prestigious postgraduate programs, research positions, and lucrative job opportunities in the public sector. It has given me a competitive edge, personal development, and the chance to contribute to the world of engineering and innovation.","In 2011, I achieved a significant feat by qualifying for the final round of 'ELECTRINA' at KRITANSH-2011, the prestigious technical festival of KIIT University. My passion for robotics found expression in this remarkable accomplishment.\n\nDuring this event, I had the opportunity to showcase my engineering prowess by designing and building various remote-controlled robots. Among these creations were specialized robots like the 'race bot' and the 'pickup bot.' What made these robots stand out was the incorporation of an advanced arm mechanism that could adeptly lift objects, enhancing their utility and functionality.","* Placed 3rd position in district level Quiz competition for WORLD TOURISM DAY,2007 conducted by Tourist Office, Government of Orissa.\n* Won 1st Prize in QUIZ competition organised by Desouza's School, Rourkela in 2007.\n* Received scholarship for securing highest marks in school in Science and English in Class 10th Board Exam .\n* Received Certificate of Excellence in a state level Talent Search Examination (TSE)-2004,2005 & 2006.\n* Awarded First Prize in the INTER SCHOOL SCIENCE EXHIBITION,2005.\n\u2022 Secured 89.91% in the 5th National Cyber Olympiad (NCO),2005 with AIR-1415, awarded by Science Olympiad Foundation (SOF). \n* Secured 99.62% in the 4th National Cyber Olympiad (NCO),2004 with AIR-42 and awarded GOLD MERIT.\n* Scholarship holder securing 1\" rank for the academic year-2002, 2003, 2004, 2005, 2007 in Desouza's school.\n* Maggie Quiz Winner organised by Nestle India Limited in the year 2003.\n* Represented the school in the INTER-SCHOOL SOFTWARE & SEMINAR CONTEST -2002 & 2003 organised by ORICOM EDUCATION.\n* Honoured with the ROURKELA STEEL PLANT (RSP) All Rounder Award for the school academic session 2002-2003.\n\nExtra-Curricular Activities and Achievements:\n\n* Winnner of INTER HOUSE soccer, basketball & volleyball tournament held in Desouza's School in 2006.\n* Passed A-certificate examination as an NCC Cadet held in 2006 under authority of ministry of defence, government. of India.\n* Runners up in open school soccer tournament-2006 organised by STEEL AUTHORITY OF INDIA LIMITED,ROURKELA (RSP).\n* Awarded 1st Prize in state level skit/drama competition of 2nd ASSOCIATION OF ORISSA ICSE SCHOOLS (AOICSES) CULTURAL FESTIVAL -2005 & 2006.\n* Voluntary contribution in the welfare of needy children, a noble step taken by EDU-CARE in 2005.\n* Received an honorable mention for being selected in National Level Programme for Middle School Students-2004, drawing/poster making competition organised by St. John's International Residential School, Chennai.\n* Awarded certificate of merit in All-India Camel Colour Contest-2000,2001 & 2003 organised by CAMLIN Limited.\n* Runners up in poster competition-2003 organised by safety engineering department,STEEL AUTHORITY OF INDIA LIMITED,ROURKELA (RSP).\n* Received 1st Prize drawing competition held on the occasion of Independence Day Celebration-2002 conducted by National Days Celebration Committee, Rourkela.\n* Yellow Belt holder and 2nd Prize winner in SHOTOKAN KARATE TOURNAMENT -2002 organised by Japan Karate Association of India."],t.s)
